#!/usr/bin/env python3
"""Insight Bot v4 - Market-optimized edition 2025-2026.

Key market insights integrated:
- Russian esoteric market: 2.4B RUB (2024), +20% YoY growth
- Audience: 68% female, 32% male, core age 26-45 (57%)
- Mobile-first: 72% traffic from mobile devices
- AI personalization is key differentiator
- Subscription model preferred over pay-per-use
- Top regions: Moscow, St. Petersburg, Yekaterinburg, Novosibirsk

New in v4:
- Admin subscription management for @ALTLPU
- Enhanced knowledge base for user engagement
- Market-optimized pricing and features

Run: python3 create_project_v4.py
"""
import os, base64, json

DATA = ""

def main():
    print(" Insight Bot v4 - Market Optimized Edition")
    print("=" * 50)
    
    # Decode and extract files
    decoded = base64.b64decode(DATA)
    files = json.loads(decoded)
    
    # Create directories
    dirs = set()
    for path in files.keys():
        dir_path = os.path.dirname(path)
        if dir_path:
            dirs.add(dir_path)
    
    for d in sorted(dirs):
        os.makedirs(d, exist_ok=True)
        print(f" {d}/")
    
    # Write files
    for path, content in files.items():
        with open(path, "w", encoding="utf-8") as f:
            f.write(content)
        print(f"   {path}")
    
    print("=" * 50)
    print("  !")
    print("\n  :")
    print("   1. cp .env.example .env")
    print("   2.  .env -  BOT_TOKEN  API ")
    print("   3. docker-compose up -d")
    print("\n Insight Bot v4   !")
    print("\n   v4:")
    print("   - @ALTLPU    ")
    print("   -    ")
    print("   -     2025-2026")

if __name__ == "__main__":
    main()
